INSERT INTO `v1_46620095d306144423d35598e9fb60084bad5065c9d6eba43f98850e5c2c3976` VALUES (11, 0.5, "もちろん、甘々で、プルプルのプリンを\nたくさん用意してきたよ～♪\n一度に頬張ったら、お口から\n垂れてきちゃうかも～♪", 0, 1, 34314, 10, 1, 100611, 34314076, 0);
