INSERT INTO `v1_46620095d306144423d35598e9fb60084bad5065c9d6eba43f98850e5c2c3976` VALUES (11, 0.5, "いや、そんなことねぇよ！？\n祝ってもらってすごくうれしいけんど、\nその気持ちをどんな素晴らしいギャグで\n表現すべきか悩んでんだべ……", 0, 1, 38214, 10, 1, 103311, 38214075, 0);
